description:
Alina goes over to her friends house only to find out that she`s not there, meanwhile Billy hurts his finger and goes to clean it up. Alina follows him into the house and finds out why Billy hasn`t had a date in awhileJenna finds out where superstar Erik lives and decides to go and get an autograph from him. When she`s there she asks him about the rumor, and to her surprise she gets a big treat! Harley is busy taking selfies when Manuel walks into the classroom. He gets mad at her and tries to take the phone away, but what he doesn`t know is that Harley wants that big cock of his.Johnny gets back from a four year military stint and runs into his neighbor Nancy. Nancy is so happy that he is back that she decides to welcome him in a very naughty way!

